import base64
from Crypto.Cipher import AES

key = b'iSyEqTCPeM0cTsVcAcsVmHZk46GG35bu'
iv = b'Rdu53JPrkODR4AGF'
encrypted_data = b''

# 解密數據
cipher = AES.new(key, AES.MODE_CBC, iv)
decoded_data = base64.b64decode(encrypted_data)
decrypted_data = cipher.decrypt(decoded_data)
decrypted_data = decrypted_data[:-decrypted_data[-1]].decode('utf-8')  # 刪除 padding 並轉換為 UTF-8 字符串
#decrypted_data = decrypted_data[:-ord(decrypted_data[-1])].decode('utf-8')  # 刪除 padding 並轉換為 UTF-8 字符串
print(decrypted_data)